import React from 'react';
import Form from 'react-bootstrap/Form';
import "./CxBusca.css"

export default function Buscador() {
	return (
		<div >
			<Form>
				<Form.Group>
					<Form.Label >Digite uma descrição:</Form.Label>
					<Form.Control className="buscadorForm" type="text" placeholder="" />
				</Form.Group>


			</Form>
		</div>
	);
}
